[{"count":0,"script":"if (doc['event.category'].value == 'network') { 
  if (doc['source.ip'].size() != 0 && doc['source.port'].size() != 0 && doc['destination.ip'].size() != 0 && doc['destination.port'].size() != 0) {
    String api_endpoint = '/docket/api/uri/';
    String host1 = doc['source.ip'].value;
    String host2 = doc['destination.ip'].value;
    String port1 = doc['source.port'].value.toString();
    String port2 = doc['destination.port'].value.toString();
    String timestamp = doc['@timestamp'].value.toString();
    timestamp = timestamp.substring(0,timestamp.indexOf('Z'));
    String begin = timestamp.substring(0,timestamp.indexOf('.')) + 'Z';

    return     api_endpoint + 
              'host/' + host1 + '/port/' + port1 +
              '/host/' + host2 + '/port/' + port2 + 
              '/after/' + begin + '/';
  }
  return '';
}
